/** @format */
import images from './assets/*.png';
import Phaser from 'phaser';
let platforms;
let player;
let cursors;
var timer = 0;
var loadingJump = false;
export default class level0 extends Phaser.Scene {
  constructor() {
    super({ key: 'level0' });
  }

  // preload() {
  //   // this.load.image('sky', 'assets/level1.png');
  //   this.load.image('ground', 'assets/platform.png');
  //   this.load.spritesheet('dude', 'assets/dude.png', {
  //     frameWidth: 32,
  //     frameHeight: 48,
  //   });
  // }

  create() {
    platforms = this.physics.add.staticGroup();

    platforms.create(180, 600, 'platform').setScale(2).refreshBody();
    platforms.create(180, 800, 'platform').setScale(2).refreshBody();
    platforms.create(600, 1155, 'platform').setScale(5).refreshBody();
    platforms.create(1020, 600, 'platform').setScale(2).refreshBody();
    platforms.create(1020, 800, 'platform').setScale(2).refreshBody();
    platforms.create(535, 160, 'platform').refreshBody();
    platforms.create(665, 160, 'platform').refreshBody();
    // platforms.create(600, 200, 'ground');
    // platforms.create(50, 250, 'ground');
    // platforms.create(750, 220, 'ground');
    this.add.image(600, 450, 'level1');
    player = this.physics.add.sprite(600, 750, 'dude').setScale(2);

    player.setBounce(0.1);
    player.setCollideWorldBounds(true);

    this.anims.create({
      key: 'left',
      frames: this.anims.generateFrameNumbers('dude', { start: 0, end: 3 }),
      frameRate: 10,
      repeat: -1,
    });

    this.anims.create({
      key: 'turn',
      frames: [{ key: 'dude', frame: 4 }],
      frameRate: 20,
    });
    this.anims.create({
      key: 'jump',
      frames: [{ key: 'dude', frame: 9 }],
      frameRate: 20,
    });
    this.anims.create({
      key: 'right',
      frames: this.anims.generateFrameNumbers('dude', { start: 5, end: 8 }),
      frameRate: 10,
      repeat: -1,
    });

    cursors = this.input.keyboard.createCursorKeys();
    this.physics.add.collider(player, platforms);
    // Phaser.scene.start(CST.SCENES.LEVEL1);
  }

  update() {
    if (cursors.left.isDown && player.body.touching.down) {
      player.setVelocityX(-300);
      player.anims.play('left', true);
    } else if (cursors.right.isDown && player.body.touching.down) {
      player.setVelocityX(300);

      player.anims.play('right', true);
    } else if (player.body.touching.down) {
      player.setVelocityX(0);
      player.anims.play('turn');
    }
    if (cursors.up.isDown && player.body.touching.down) {
      player.setVelocityX(0);
      player.anims.play('jump');
      loadingJump = true;
      if (timer < 70) {
        timer += 1;
      }
      // time is in ms
    } else if (loadingJump === true) {
      if (timer < 10) {
        player.body.velocity.y = -400;
      } else if (timer < 20) {
        player.body.velocity.y = -500;
      } else if (timer < 30) {
        player.body.velocity.y = -600;
      } else if (timer < 40) {
        player.body.velocity.y = -700;
      } else if (timer < 50) {
        player.body.velocity.y = -800;
      } else if (timer < 55) {
        player.body.velocity.y = -900;
      } else if (timer < 60) {
        player.body.velocity.y = -1000;
      } else if (timer < 65) {
        player.body.velocity.y = -1100;
      } else if (timer > 65) {
        player.body.velocity.y = -1150;
      }
      if (cursors.right.isDown) {
        player.body.velocity.x = 300;
        console.log(timer);
      }
      loadingJump = false;
      timer = 0;
    }
    // Edit: changed the timing
  }
}
